import styled from "styled-components";

const SignInStyled = styled.div`
  width: 23vw;
  display: flex;
  flex-direction: column;

  .title {
    margin: 10px 0;
  }
  .buttons {
    display: flex;
    justify-content: space-between;
  }
`;
export default SignInStyled;
